// C:\react-js\my-app\src\components\signup.js
import { useState } from "react";
import Axios from "axios";

const SignUp = () => {
    const [email, setEmail] = useState("");
    const [name, setName] = useState("");
    const [password, setPassword] = useState("");
    const [registerStatus, setRegisterStatus] = useState("");

    const register = (e) => {
        e.preventDefault();
        Axios.post("http://localhost:3001/register", {
            email: email,
            name: name,
            password: password,
        }).then((response) => {
            console.log(response);
            if (response.data.message) {
                setRegisterStatus(response.data.message);
            } else {
                setRegisterStatus("ACCOUNT CREATED SUCCESSFULLY");
            }
        });
    };

    let imgs = [
        'https://as2.ftcdn.net/v2/jpg/03/39/70/91/1000_F_339709132_H9HSSTtTmayePcbARkTSB2qoZTubJ6bR.jpg',
    ];
    
    return (
        <div className="container" style={{ paddingTop: 60 }}>
            <div className="container-fluid h-custom">
                <div className="row d-flex justify-content-center align-items-center h-100">
                    <div className="col-md-8 col-lg-6 col-xl-4 offset-xl-1">
                        <form onSubmit={register}>
                            <div className="d-flex flex-row align-items-center justify-content-center justify-content-lg-start">
                                <p className="lead fw-normal mb-0 me-3">Create Your Account</p>
                            </div>
                            <h1 style={{ fontSize: '15px', textAlign: 'center', marginTop: '20px' }}>{registerStatus}</h1>
                            <div className="form-outline mb-4">
                                <input
                                    type="text"
                                    className="form-control form-control-lg"
                                    placeholder="Enter your Name"
                                    onChange={(e) => { setName(e.target.value); }}
                                    required
                                />
                                <label className="form-label">Name</label>
                            </div>
                            <div className="form-outline mb-4">
                                <input
                                    type="email"
                                    className="form-control form-control-lg"
                                    placeholder="Enter your Email Address"
                                    onChange={(e) => { setEmail(e.target.value); }}
                                    required
                                />
                                <label className="form-label">Email address</label>
                            </div>
                            <div className="form-outline mb-3">
                                <input
                                    type="password"
                                    className="form-control form-control-lg"
                                    placeholder="Enter your Password"
                                    onChange={(e) => { setPassword(e.target.value); }}
                                    required
                                />
                                <label className="form-label">Password</label>
                            </div>
                            <div className="d-flex justify-content-between align-items-center">
                                <div className="form-check mb-0">
                                    <input className="form-check-input me-2" type="checkbox" value="" required />
                                    <label className="form-check-label">
                                        Remember me
                                    </label>
                                </div>
                                <a href="#" className="text-body">Forgot password?</a>
                            </div>
                            <div className="text-center text-lg-start mt-4 pt-2">
                                <button type="submit" className="btn btn-primary btn-lg">Sign Up</button>
                                <p className="small fw-bold mt-2 pt-1 mb-0">Already have an account? <a href="login" className="link-danger">Login</a></p>
                            </div>
                        </form>
                    </div>
                    <div className="col-md-9 col-lg-6 col-xl-5">
                        <img src={imgs[0]} className="img-fluid" alt="Sample" />
                    </div>
                </div>
            </div>
        </div>
    );
};

export default SignUp;
